About Game:
************
BlazeRush is a dynamic arcade racing survival game with no health, no
levelling and no brakes!

You can assemble a team of friends to play in local or online
multiplayer, choose a car to your taste and chase, blow up and cut off!

Adapt your style and tactics to new enemies, obstacles and tracks

Welcome to the World Of Racing and Frantic Fun!


